import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom";
// import PaginatorBasicDemo from "./Admin Componts/Table";
import { useLocation } from "react-router-dom";
import { useNavigate } from "react-router-dom";
import "./admin.css";
import Optab from "./Optab";
import logo from "../../images/hospital_logo.png";
import axios from "axios";
import { wait } from "@testing-library/user-event/dist/utils";

const AdminPage = () => {
  const location = useLocation();
  // console.log(location.state);
  const navigate = useNavigate();

  const [isCheckedIn, setIsCheckedIn] = useState(false);
  const [checkInTime, setCheckInTime] = useState(null);
  const [checkIndate, setCheckIndate] = useState(null);
  const [checkOutTime, setCheckOutTime] = useState(null);
  const [checkOutdate, setCheckOutdate] = useState(null);

  const checked = () => {
    axios
      .post(
        `http://localhost:3002/check/checkpost/${sessionStorage.getItem("ID")}`,
        cheek
      )
      .then((res) => {
        console.log(res.data);
      })
      .catch((error) => {
        console.log(error);
      });
  };
  const handleButtonClick = () => {
    if (isCheckedIn) {
      console.time("myfuncto");
      let date = new Date();
      let time = date.toLocaleTimeString();
      let dates =
        date.getFullYear() + "-" + (date.getMonth() + 1) + "-" + date.getDate();

      setCheckOutTime(time);
      setCheckOutdate(dates);
      console.timeEnd("myfuncto");
      if (checkOutTime == null || checkOutdate == null) {
        console.log("wait");
      } else {
        checked();
      }

      // checked();
      // navigate("/employelogin");
    } else {
      let date = new Date();
      let time = date.toLocaleTimeString();
      let dates =
        date.getFullYear() + "-" + (date.getMonth() + 1) + "-" + date.getDate();

      setCheckInTime(time);
      setCheckIndate(dates);

      console.log("first");
    }
    setIsCheckedIn((prevState) => !prevState);
  };
  const [use, setuse] = useState([
    checkInTime,
    checkIndate,
    checkOutTime,
    checkOutdate,
  ]);
  console.log(use, "usr");
  console.log(checkOutdate, "checkOutdate");

  let cheek = {
    checkintime: use.it,
    checkindate: use.id,
    checkouttime: use.oi,
    checkoutdate: use.od,
  };
  console.log(cheek);

  return (
    <div>
      <div className="container-9">
        <div className="nav">
          <Link className="logo" to="/">
            <img src={logo} id="logov" />
          </Link>
          <ul className=" list" type="none">
            <li>
              <Link className="li" to="/leave">
                Apply Leave
              </Link>
            </li>
            <li
              className={
                location.state.employerole === "doctor" ? "" : "hiiden"
              }
            >
              <Link className="li" to="/doctor">
                Doctor Visit
              </Link>
            </li>
            {console.log(location.state.employerole)}
            <li
              className={
                location.state.employerole === "FRONTLINE WORKER"
                  ? ""
                  : "hiiden"
              }
            >
              <Link className="li" to="/appoinment">
                OP entry
              </Link>
            </li>
            <li className={location.state.employerole === "HR" ? "" : "hiiden"}>
              <Link className="li" to="/employeregister">
                Add Employe
              </Link>
            </li>
            <li>
              <Link className="li" to="/editemploye">
                Edit Profile
              </Link>
            </li>
            {/* <li className="user">
              <i class="fa-solid fa-user"></i>
            </li> */}
            <li className="www">
              {location.state.name} {location.state.employerole}
            </li>
            <li className="www">
              <button onClick={handleButtonClick}>
                {isCheckedIn ? "Check Out" : "Check In"}
              </button>
              {checkInTime && (
                <span>
                  Check-in time: {checkInTime}
                  Check-in date: {checkIndate}
                </span>
              )}
              {checkOutTime && (
                <span>
                  Check-out time: {checkOutTime}
                  Check-date: {checkOutdate}
                </span>
              )}
            </li>
          </ul>
        </div>
      </div>
      {<Optab />}
    </div>
  );
};

export default AdminPage;
